0\ \=\ libre,\ no;\ 1\ \=\ marcado,\ s\u00ed.\ =\u0030\u0020\u003d\u0020\u0431\u0435\u0441\u043f\u043b\u0430\u0442\u043d\u043e\u002c\u0020\u043d\u0435\u0442\u003b\u0020\u0031\u0020\u003d\u0020\u043f\u0440\u043e\u0432\u0435\u0440\u0435\u043d\u043e\u002c\u0020\u0434\u0430\u002e\u0020
Debe\ introducir\ un\ valor.\ =\u0412\u044b\u0020\u0434\u043e\u043b\u0436\u043d\u044b\u0020\u0432\u0432\u0435\u0441\u0442\u0438\u0020\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435\u002e\u0020
El\ mes\ debe\ ser\ un\ n\u00famero\ entre\ 1\ y\ 12.\ =\u041c\u0435\u0441\u044f\u0446\u0020\u0434\u043e\u043b\u0436\u0435\u043d\u0020\u0431\u044b\u0442\u044c\u0020\u0447\u0438\u0441\u043b\u043e\u043c\u0020\u043e\u0442\u0020\u0031\u0020\u0434\u043e\u0020\u0031\u0032\u002e\u0020
El\ valor\ est\u00e1\ fuera\ del\ rango\ =\u0417\u043d\u0430\u0447\u0435\u043d\u0438\u0435\u0020\u0432\u043d\u0435\u0020\u0434\u043e\u043f\u0443\u0441\u0442\u0438\u043c\u043e\u0433\u043e\u0020\u0434\u0438\u0430\u043f\u0430\u0437\u043e\u043d\u0430\u0020
El\ valor\ no\ es\ una\ opci\u00f3n\ v\u00e1lida.\ =\u0417\u043d\u0430\u0447\u0435\u043d\u0438\u0435\u0020\u043d\u0435\u0020\u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f\u0020\u0434\u043e\u043f\u0443\u0441\u0442\u0438\u043c\u043e\u0439\u0020\u043e\u043f\u0446\u0438\u0435\u0439\u002e
Error\ al\ convertir\ el\ valor\ digitalmente.\ =\u041e\u0448\u0438\u0431\u043a\u0430\u0020\u043f\u0440\u0435\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f\u0020\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f\u0020\u0432\u0020\u0446\u0438\u0444\u0440\u043e\u0432\u0443\u044e\u0020\u0444\u043e\u0440\u043c\u0443\u002e\u0020
Error\ en\ el\ formato\ de\ ruta\ y\ archivo.\ =\u041e\u0448\u0438\u0431\u043a\u0430\u0020\u0432\u0020\u043f\u0443\u0442\u0438\u0020\u0438\u0020\u0444\u043e\u0440\u043c\u0430\u0442\u0435\u0020\u0444\u0430\u0439\u043b\u0430\u002e\u0020
Falta\ la\ entrada\ del\ mapa\:\ =\u0417\u0430\u043f\u0438\u0441\u044c\u0020\u043a\u0430\u0440\u0442\u044b\u0020\u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442\u003a\u0020
La\ semana\ debe\ ser\ un\ n\u00famero\ entre\ 1\ y\ 52.\ =\u041d\u0435\u0434\u0435\u043b\u044f\u0020\u0434\u043e\u043b\u0436\u043d\u0430\u0020\u0431\u044b\u0442\u044c\u0020\u0447\u0438\u0441\u043b\u043e\u043c\u0020\u043e\u0442\u0020\u0031\u0020\u0434\u043e\u0020\u0035\u0032\u002e\u0020
No\ encontrado.\ =\u041d\u0435\u0020\u043d\u0430\u0439\u0434\u0435\u043d\u043e\u002e\u0020
No\ existe\ la\ fase\ de\ captura\ en\ este\ formulario.\ =\u0412\u0020\u044d\u0442\u043e\u0439\u0020\u0444\u043e\u0440\u043c\u0435\u0020\u043d\u0435\u0442\u0020\u0444\u0430\u0437\u044b\u0020\u0437\u0430\u0445\u0432\u0430\u0442\u0430\u002e\u0020
